create table cases
(
    case_id              text,
    product              text,
    d_type               text,
    supplier             text,
    jira_request         text,
    required_by          text,
    received_date        text,
    m_lead_time_in_weeks numeric,
    m_lead_time_in_days  numeric,
    item_type            text,
    next_delivery_date   text,
    d_created            timestamp,
    updated              timestamp with time zone,
    location             text,
    total_amount         numeric,
    tax_amount           numeric
);

alter table cases
    owner to postgres;

